import { lazy } from "react";
import { authRoles } from "app/auth/authRoles";

const Company = lazy(() => import("./Company"));


const companyRouter = [
    {
        path: "/company/v1",
        component: Company,
        auth: authRoles.admin
    }
    // ,
    // {
    //     path: "/Company/viewCompany",
    //     component: viewNotification,
    //     auth: authRoles.admin
    // },

];

export default companyRouter;
